import * as React from 'react';

export interface GrowingProps {
  visible: boolean;
}

const Growing: React.SFC<GrowingProps> = ({ visible }) => {
  return (
    <span
      className={`spinner-grow spinner-grow-sm ${visible ? null : 'd-none'} `}
      role="status"
      aria-hidden="true"
    ></span>
  );
};

export default Growing;
